import axios from "axios";
import { set } from "mongoose";
import { useEffect, useState } from "react";
import "./KitchenService.css";

const deleteFromDataBase = () => {
  prompt("Are you sure?");
};

const KitchenService = () => {
  const [display, setDisplay] = useState([]);

  useEffect(() => {
    axios
      .get("http://localhost:8081/fetchFromDataBase")
      .then((display) => setDisplay(display.data))
      .catch((err) => console.log(err));
  }, []);

  return (
    <div>
      {
        <tr>
          <th>
            <span className="kitchen-head-section"> </span>
          </th>
          <th>
            <span className="kitchen-head-section">Order</span>
          </th>
          <th>
            <span className="kitchen-head-quantity">Quantity</span>
          </th>
        </tr>
      }
      {display.map((item) => {
        return (
          <>
            <table>
              <tr>
                <td>
                  <input type="checkbox" onClickCapture={alert()}></input>
                </td>
                <td>
                  <span style={{ padding: "50px" }}>{item.name}</span>
                </td>
                <td>
                  <span style={{ padding: "20px" }}>{item.quantity}</span>
                </td>
                <td>
                  <button onclick={deleteFromDataBase}>Confirm</button>
                </td>
              </tr>
            </table>
          </>
        );
      })}
    </div>
  );
};

export default KitchenService;
